{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/akprodromou/data-cleaning-stop-and-search-in-the-uk?scriptVersionId=196960323\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"bb99abe2","metadata":{"papermill":{"duration":0.024827,"end_time":"2024-09-17T04:44:22.444213","exception":false,"start_time":"2024-09-17T04:44:22.419386","status":"completed"},"tags":[]},"source":["# Data cleaning: Stop and search in the UK\n","\n","## Contents\n","\n","1. [Introduction](#section-intro)\n","2. [Data Collection](#section-env)\n","3. [Data Cleaning](#section-clean)  \n","  3.1. [Column renaming](#section-rename)  \n","  3.2. [Data Type conversion](#section-convert)  \n","  3.3. [Remove Columns](#section-remove)  \n","  3.4. [Replace missing values](#section-replace)  \n","  3.5. [Check for outliers](#section-outliers)  \n","  3.6. [Deal with Duplicates](#section-dupl)\n","4. [Data Analysis and Visualization](#section-viz)  \n","5. [Main findings](#section-findings)\n","\n"]},{"cell_type":"markdown","id":"6012dacd","metadata":{"papermill":{"duration":0.024323,"end_time":"2024-09-17T04:44:22.491605","exception":false,"start_time":"2024-09-17T04:44:22.467282","status":"completed"},"tags":[]},"source":["<a id=\"section-intro\"></a>\n","## 1. Introduction  \n","This analysis focuses on the police stop and search figures provided by the UK Government at [data.gov.uk](https://www.ethnicity-facts-figures.service.gov.uk/crime-justice-and-the-law/policing/stop-and-search/latest). It's main aim is to understand the data available, and to clean it appropriately using the R programming language. Some analysis and visualization also takes place at the end!\n","\n","To provide some background, a police officer has powers to stop and search you in the UK if they have ‘reasonable grounds’ to suspect you’re carrying illegal drugs, a weapon, stolen property or something which could be used to commit a crime. You can only be stopped and searched without reasonable grounds if it has been approved by a senior police officer. This can happen if it is suspected that: a) serious violence could take place b) you’re carrying a weapon or have used one c) you’re in a specific location or area. Being searched doesn’t mean you’re being arrested.\n","\n","As part of the process, the police officers ask for a name and address, date of birth and *self-defined* ethnicity. One doesn't have to give this information if they don't want to; unless the police officer says they're reporting them for an offence."]},{"cell_type":"markdown","id":"ef6c1009","metadata":{"papermill":{"duration":0.02197,"end_time":"2024-09-17T04:44:22.535448","exception":false,"start_time":"2024-09-17T04:44:22.513478","status":"completed"},"tags":[]},"source":["<a id=\"section-env\"></a>\n","## 2. Data Collection"]},{"cell_type":"markdown","id":"cc168ffa","metadata":{"papermill":{"duration":0.021936,"end_time":"2024-09-17T04:44:22.579311","exception":false,"start_time":"2024-09-17T04:44:22.557375","status":"completed"},"tags":[]},"source":["Let's start by loading the libraries and the data we'll need:"]},{"cell_type":"code","execution_count":1,"id":"b8bdcd5c","metadata":{"_kg_hide-input":false,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2024-09-17T04:44:22.627494Z","iopub.status.busy":"2024-09-17T04:44:22.625175Z","iopub.status.idle":"2024-09-17T04:44:24.88881Z","shell.execute_reply":"2024-09-17T04:44:24.886801Z"},"papermill":{"duration":2.290184,"end_time":"2024-09-17T04:44:24.891512","exception":false,"start_time":"2024-09-17T04:44:22.601328","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.5.0 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","Loading required package: timechange\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘maps’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    map\n","\n","\n","\u001b[1mRows: \u001b[22m\u001b[34m17748\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m13\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m (13): Measure, Time, Time_type, Ethnicity, Ethnicity_type, Legislation_t...\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n"]}],"source":["# libraries we'll need\n","library(tidyverse)\n","library(lubridate)\n","library(maps)\n","\n","# read in the data we'll need\n","stop_and_search_raw <- read_csv(\"/kaggle/input/stop-and-search-by-ethnicity-uk/stop-and-search-data.csv\") %>%\n","    janitor::clean_names()"]},{"cell_type":"code","execution_count":2,"id":"cd00ece3","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44:24.975687Z","iopub.status.busy":"2024-09-17T04:44:24.939595Z","iopub.status.idle":"2024-09-17T04:44:25.011878Z","shell.execute_reply":"2024-09-17T04:44:25.0095Z"},"papermill":{"duration":0.099951,"end_time":"2024-09-17T04:44:25.014647","exception":false,"start_time":"2024-09-17T04:44:24.914696","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Rows: 17,748\n","Columns: 13\n","$ measure                                                                                                                  \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ time                                                                                                                     \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ time_type                                                                                                                \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ ethnicity                                                                                                                \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ ethnicity_type                                                                                                           \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ legislation_type                                                                                                         \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ geography                                                                                                                \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ geography_type                                                                                                           \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ number_of_stop_and_searches                                                                                              \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ total_number_of_stop_and_search_carried_out_in_this_year_in_this_area_excluding_cases_where_the_ethnicity_was_unreported \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ population_by_ethnicity                                                                                                  \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ rate_per_1_000_population_by_ethnicity                                                                                   \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n","$ proportion_of_total_stop_and_searches_of_this_ethnicity_in_the_financial_year_excludes_unreported                        \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m …\n"]}],"source":["glimpse(stop_and_search_raw)"]},{"cell_type":"markdown","id":"010068a5","metadata":{"papermill":{"duration":0.024626,"end_time":"2024-09-17T04:44:25.062975","exception":false,"start_time":"2024-09-17T04:44:25.038349","status":"completed"},"tags":[]},"source":["We first need to understand what the data refers to: it provides 17,748 data points with the number of stops and searches by police in the UK, grouped by regions, ethnicity of the person stoped, the reason behind the stop (legislation_type), as well as the population of various ethnicities in the various regions. There is also a distinction between total cases, and cases where ethnicity wasn't reported. The calculated metrics provided are:\n","> **'Rate per 1,000 population by ethnicity'**: Number of stops for an ethnicity, divided by the Total population of the ethnicity in the region (rate per 1000).  \n","> **'Proportion of total stop and searches of this ethnicity in the financial year (excludes unreported)'**:  Number of stops for an ethnicity, divided by the Total number of stops (rate per 100).\n","\n","Is our data reliable? According to the ROACC approach:\n","> **R**eliable: Completeness HIGH (full data 2006-2020 for all UK Police Force Areas), while the accuracy will be assessed once cleaning has been completed  \n","> **O**riginal: MED — Second party provider (UK Police Stations)  \n","> **C**omprehensive: HIGH — The metrics are clear and comparable  \n","> **C**urrent: MED — Data is as recent as 2020  \n","> **C**ited: HIGH — Data title, source and parties responsible are clear  \n","\n","<a id=\"section-clean\"></a>\n","## 3. Data cleaning\n","\n","<a id=\"section-rename\"></a>\n","### 3.1. Column renaming\n","Let's start by renaming some columns whose length makes them unhandy:"]},{"cell_type":"code","execution_count":3,"id":"3aaaca11","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44:25.113438Z","iopub.status.busy":"2024-09-17T04:44:25.111657Z","iopub.status.idle":"2024-09-17T04:44:25.207541Z","shell.execute_reply":"2024-09-17T04:44:25.205508Z"},"papermill":{"duration":0.123806,"end_time":"2024-09-17T04:44:25.210317","exception":false,"start_time":"2024-09-17T04:44:25.086511","status":"completed"},"tags":[]},"outputs":[],"source":["stop_and_search_raw <- stop_and_search_raw %>% \n","       rename(total_number_with_reported_ethnicity = 10, proportion_ethnicity_to_total_stops = 13)"]},{"cell_type":"markdown","id":"bbe66b1a","metadata":{"papermill":{"duration":0.023046,"end_time":"2024-09-17T04:44:25.256358","exception":false,"start_time":"2024-09-17T04:44:25.233312","status":"completed"},"tags":[]},"source":["<a id=\"section-convert\"></a>\n","### 3.2. Data type conversion\n","R has read all our columns as character data types. We therefore need to convert them appropriately, where needed:\n","- Time column: from character to number. The date provided is that of a financial year (e.g. 2006/07). We will extract the first 4 characters to get just the first year of the two, and then convert it to an integer data type so we can plot it. "]},{"cell_type":"code","execution_count":4,"id":"65c7fd70","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44: