4/47a'</li><li>'Section 60'</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 'All'\n","\\item 'Section 1'\n","\\item 'Section 44/47a'\n","\\item 'Section 60'\n","\\end{enumerate*}\n"],"text/markdown":["1. 'All'\n","2. 'Section 1'\n","3. 'Section 44/47a'\n","4. 'Section 60'\n","\n","\n"],"text/plain":["[1] \"All\"            \"Section 1\"      \"Section 44/47a\" \"Section 60\"    "]},"metadata":{},"output_type":"display_data"}],"source":["sort(unique(stop_and_search_raw$legislation_type))"]},{"cell_type":"markdown","id":"65d9b6b9","metadata":{"papermill":{"duration":0.024578,"end_time":"2024-09-17T04:44:25.664979","exception":false,"start_time":"2024-09-17T04:44:25.640401","status":"completed"},"tags":[]},"source":["Through an online search we find out that:\n","> **Section 1**: An officer can stop, detain, and search any person or vehicle in a public place, as long as the officer has 'reasonable grounds' for suspecting that they will find stolen or prohibited articles.  \n","> **Section 44/47a (Terrorism Act)**: Enables a senior police officer to authorise 'suspicionless' stop and searches within a specific area for a limited time.  \n","> **Section 60**: Used to prevent and detect the carrying of dangerous instruments or offensive weapons.  \n","\n","Let's now have a look at the map of the areas examined. To map our locations, we will use the latitude and longitude data provided for each Police Force Area by the [UK Open Geography Portal](https://geoportal.statistics.gov.uk/datasets/police-force-areas-dec-2021-ew-bfe/explore?location=53.504108%2C-0.229704%2C5.99)."]},{"cell_type":"code","execution_count":7,"id":"61e49465","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44:25.718291Z","iopub.status.busy":"2024-09-17T04:44:25.716498Z","iopub.status.idle":"2024-09-17T04:44:27.151655Z","shell.execute_reply":"2024-09-17T04:44:27.148944Z"},"papermill":{"duration":1.46918,"end_time":"2024-09-17T04:44:27.158817","exception":false,"start_time":"2024