   \n","2 All       Avon & Somerset 165.94                                 \n","3 All       Humberside      154.53                                 \n","4 All       Merseyside      153.98                                 \n","5 All       Cheshire        152.77                                 \n","6 All       London, City of 152.44                                 "]},"metadata":{},"output_type":"display_data"}],"source":["# Create a new column to calculate the proportion of total stops by ethnicity to the total stops, excluding unreported\n","stop_and_search <- stop_and_search %>%\n","  mutate(proportion_ethnicity_to_total_stops_new = round(number_of_stop_and_searches / total_number_with_reported_ethnicity * 100, 2))\n","\n","head(stop_and_search[order(-stop_and_search$proportion_ethnicity_to_total_stops_new),]) %>%\n","  filter(proportion_ethnicity_to_total_stops_new > 100) %>%\n","  select(c(ethnicity, geography, proportion_ethnicity_to_total_stops_new))"]},{"cell_type":"markdown","id":"828d8bb9","metadata":{"papermill":{"duration":0.037516,"end_time":"2024-09-17T04:44:50.573695","exception":false,"start_time":"2024-09-17T04:44:50.536179","status":"completed"},"tags":[]},"source":["So let's assign the NA value to the proportion column in those cases:"]},{"cell_type":"code","execution_count":20,"id":"30355987","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44:50.653111Z","iopub.status.busy":"2024-09-17T04:44:50.65129Z","iopub.status.idle":"2024-09-17T04:44:50.680166Z","shell.execute_reply":"2024-09-17T04:44:50.678112Z"},"papermill":{"duration":0.072036,"end_time":"2024-09-17T04:44:50.683619","exception":false,"start_time":"2024-09-17T04:44:50.611583","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["-2"],"text/latex":["-2"],"text/markdown":["-2"],"text/plain":["[1] -2"]},"metadata":{},"output_type":"display_data"}],"source":["# Re-calculate the new proportion column, excluding data points where ethnicity = 'All'\n","stop_and_search <- s