edian."]},{"cell_type":"code","execution_count":22,"id":"b56874fd","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44:51.037529Z","iopub.status.busy":"2024-09-17T04:44:51.035769Z","iopub.status.idle":"2024-09-17T04:44:51.598893Z","shell.execute_reply":"2024-09-17T04:44:51.59588Z"},"papermill":{"duration":0.607208,"end_time":"2024-09-17T04:44:51.602533","exception":false,"start_time":"2024-09-17T04:44:50.995325","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“\u001b[1m\u001b[22mRemoved 2156 rows containing non-finite values (`stat_boxplot()`).”\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAWgCAIAAADW05emAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzde5zVBZ3/8e/3HO43GRxwQBAUSVrNJAOlBMQLCF3MEM11YXXX2z5oXbtYrW6b\nq79s09bUTVO7aWVpeVkzdS0VhUIqFdeHKK4oJaJyHUbgMHBmzvn9MS6kM4xHnDPn05zn8w8f\nM9/vMLz97zxefC9psVhMAAAAAIAYMpUeAAAAAADsJNgBAAAAQCCCHQAAAAAEItgBAAAAQCCC\nHQAAAAAEItgBAAAAQCCCHQAAAAAEItgBAAAAQCDdKj2gAzQ1NW3atKnSKwAAupr+/ftnMpnG\nxsZt27ZVegsAQFdTU1Ozq1NdIdgVi8Xm5uZKrwAA6GrSNM1kMkmS+KwFANCZ3BILAAAAAIEI\ndgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAH\nAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAA\nAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAA\nAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQ\niGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEI\ndgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAH\nAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAA\nAAAQiGAHAAAAAIEIdgAAAAAQiGAHAAAAAIEIdgAAAAAQSLdKDwAAIJzGxsY77rjj6aefXrdu\n3ciRI6dNmzZ+/PhKjwIAqBZpsVis9IZ3K5/PNzQ0VHoFAEAXsXr16vPPP3/NmjVpmhaLxUwm\nUygUpk2b9pnPfCZN00qvAwDoImpra3d1yi2xAAC8yVVXXbV27dokSVr+ZbdQKCRJ8qtf/WrB\nggUVXgYAUB0EOwAAdtq4ceOSJUta34SRyWQefPDBikwCAKg2gh0AADutWbOmzUemFAqFV199\ntfP3AABUIcEOAICd+vbt2+bxNE379+/fyWMAAKqTYAcAwE7Dhg3ba6+9Mpm3fkosFoteFAsA\n0DkEOwAAdk