iminal history of such a group that lead to them; but most likely wrong data entry can be excluded. \n","\n","We also notice that the City of London values are missing, while the Greater London values are given under the 'Metropolitan Police' label:\n","\n","> **The Metropolitan Police** is the service for the Greater London area, (excluding City of London) and its 8.6 million residents. \n","\n","Upon inspection, we realise that the reason is that the Population by ethnicity column is missing for the city of London:"]},{"cell_type":"code","execution_count":27,"id":"2d9e1b36","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:44:54.836067Z","iopub.status.busy":"2024-09-17T04:44:54.834372Z","iopub.status.idle":"2024-09-17T04:44:54.860388Z","shell.execute_reply":"2024-09-17T04:44:54.858421Z"},"papermill":{"duration":0.078988,"end_time":"2024-09-17T04:44:54.863109","exception":false,"start_time":"2024-09-17T04:44:54.784121","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["&lt;NA&gt;"],"text/latex":["<NA>"],"text/markdown":["&lt;NA&gt;"],"text/plain":["[1] NA"]},"metadata":{},"output_type":"display_data"}],"source":["stop_and_search %>%\n","  filter(geography == 'London, City of') %>%\n","  {unique(.$population_by_ethnicity)}"]},{"cell_type":"markdown","id":"32325a41","metadata":{"papermill":{"duration":0.048064,"end_time":"2024-09-17T04:44:54.959036","exception":false,"start_time":"2024-09-17T04:44:54.910972","status":"completed"},"tags":[]},"source":["As London is UK's capital and largest city, this is an important deficiency. This data is available for 2021 on [data.gov.uk](https://www.ethnicity-facts-figures.service.gov.uk/uk-population-by-ethnicity/national-and-regional-populations/regional-ethnic-diversity/latest#download-the-data) and we will use it as rough approximates to fill in the missing values for 2019 in our table. First, let's inspect the column entries and make sure that the naming of ethnicities agree:"]},{"cell_type":"code