display_data"}],"source":["# Create a table grouped by ethnicity and time\n","stop_and_search_annual_totals <- stop_and_search %>% \n","  group_by(time) %>% \n","  filter(geography == 'All - including BTP', legislation_type == 'All', ethnicity == 'All') \n","\n","# Make the graph visible\n","options(repr.plot.width = 9, repr.plot.height = 8)\n","\n","# Create a plot\n","ggplot() +\n","  geom_line(stop_and_search_annual_totals,\n","    mapping = aes(x=time, y=number_of_stop_and_searches)) +\n","    ggtitle(\"Stop and search per annum in the UK (2009-2020)\") + \n","  theme_minimal() +\n","  theme(text = element_text(family = \"serif\"),\n","       axis.title.x = element_text(size = 15, margin = margin(t = 50)),\n","       axis.title.y = element_text(size = 15, margin = margin(r = 50)),\n","       plot.title = element_text(size = 18, face=\"bold\", margin=margin(50,50,50,0)),\n","    ) +\n","  labs(y = \"Number of stop and searches\", x = \"Time (year)\") +\n","  scale_x_continuous(n.breaks=10)"]},{"cell_type":"markdown","id":"14ac6058","metadata":{"papermill":{"duration":0.058615,"end_time":"2024-09-17T04:45:02.59539","exception":false,"start_time":"2024-09-17T04:45:02.536775","status":"completed"},"tags":[]},"source":["There was a total of 1,391,079 stop and searches in 2009 in the UK compared to 697,405 in 2020, with the lowest over the 2009-2020 period noted in 2017 (277,508).\n","\n","Let's plot the changes over time per ethnic group, for the top groups:"]},{"cell_type":"code","execution_count":41,"id":"fac67940","metadata":{"execution":{"iopub.execute_input":"2024-09-17T04:45:02.716795Z","iopub.status.busy":"2024-09-17T04:45:02.715068Z","iopub.status.idle":"2024-09-17T04:45:03.389656Z","shell.execute_reply":"2024-09-17T04:45:03.387456Z"},"papermill":{"duration":0.738684,"end_time":"2024-09-17T04:45:03.393804","exception":false,"start_time":"2024-09-17T04:45:02.65512","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u0