cA\nAAAAALA8Ag4AAAAAAGB5/x8Gq+SL8zuZXwAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":480,"width":720}},"output_type":"display_data"}],"source":["# Create a table grouped by legislation type and time\n","stop_and_search_means_legislation <- stop_and_search %>% \n","  group_by(legislation_type, time) %>% \n","  filter(geography == 'All - excluding BTP') %>% # since there are few All-including BTP entries filled-in \n","  summarize(mean_rate=mean(rate_per_1_000_population_by_ethnicity_new, na.rm = TRUE))\n","\n","# Create a plot\n","ggplot() +\n","  geom_line(stop_and_search_means_legislation %>%\n","    filter(!grepl('All', legislation_type)),\n","    mapping = aes(x=time, y=mean_rate, color=legislation_type)) +\n","  geom_line(stop_and_search_means_legislation  %>%\n","    filter(grepl('All', legislation_type)),\n","    mapping = aes(x=time, y=mean_rate, color=legislation_type),size=3) +\n","    ggtitle(\"Stop and search per legislation type in the UK, over time\") + \n","  theme_minimal() +\n","  theme(text = element_text(family = \"serif\"),\n","       axis.title.x = element_text(size = 15, margin = margin(t = 50)),\n","       axis.title.y = element_text(size = 15, margin = margin(r = 50)),\n","       plot.title = element_text(size = 18, face=\"bold\", margin=margin(50,0,50,0)),\n","       legend.title = element_text(size = 15, face=\"bold\"),\n","       legend.text = element_text(size = 15, margin = margin(10,10,10,10)),\n","       legend.spacing.y = unit(0.5, 'cm')) +\n","  labs(y = \"Number of stop and searches per 1000 people\", x = \"Time (year)\") +\n","  guides(color = guide_legend(title = \"Legislation type\")) +\n","  scale_x_continuous(n.breaks=10)"]},{"cell_type":"markdown","id":"953c5fcf","metadata":{"papermill":{"duration":0.062968,"end_time":"2024-09-17T04:45:04.31446","exception":false,"start_time":"2024-09-17T04:45:04.251492","status":"completed"},"tags":[]},"source":["The graph shows that stops under legislations Section 44/47a (Terrorism Act) and Section 60 (Carrying of offensive weapons) have a minor contribution to the total over the years."]},{"cell_type":"markdown","id":"9ccc94fa","metadata":{"papermill":{"duration":0.062344,"end_time":"2024-09-17T04:45:04.440696","exception":false,"start_time":"2024-09-17T04:45:04.378352","status":"completed"},"tags":[]},"source":["<a id=\"section-findings\"></a>\n","## 5. Main findings  \n","\n","* There was a total of 1,391,079 stop and searches in 2009 in the UK compared to 697,405 in 2020, with the lowest over the 2009-2020 period noted in 2017 (277,508), and picking thenafter.\n","* The top ethnicities to be stopped and searched in the UK are Any Other Black Background (128 per 1000 people), Black Caribbean (64), Black African (37), Bangladeshi (33) and Black (31). The bottow 5 include White (5.5), Chinese (4.1) and Arab (1.3). \n","* The UK areas where most stop and searches take place are Greater London - City of London, Merseyside (Liverpool), Essex, South Yorkshire, South Wales. \n","* Almost half of all stop and searches took place in the Metropolitan Police force area in London, and that can be explained by the fact that it comprises mostly office spaces (hence low number of resident population), it has increased security concerns as a major tourist destination and home of UK politics venues (hence the high number of stops and searches).\n","\n","\n","That's all. Thanks!"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":2875735,"sourceId":4958801,"sourceType":"datasetVersion"},{"datasetId":2879185,"sourceId":4964452,"sourceType":"datasetVersion"},{"datasetId":2903887,"sourceId":5004895,"sourceType":"datasetVersion"},{"datasetId":2910733,"sourceId":5016025,"sourceType":"datasetVersion"},{"datasetId":2915718,"sourceId":5024554,"sourceType":"datasetVersion"},{"datasetId":2919937,"sourceId":5031324,"sourceType":"datasetVersion"}],"dockerImageVersionId":30372,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":46.156347,"end_time":"2024-09-17T04:45:04.62663","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-09-17T04:44:18.470283","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}